import React from 'react';
import '../Styles/App.css';
import {BrowserRouter as Router, Route, Switch, Redirect} from 'react-router-dom'
import HomePage from './HomePage'

class Main extends React.Component {

render() {
    return (

        <Router>



            <Switch>

            <Route exact path='/'> 
                <HomePage />
            </Route>


            </Switch>
        </Router>
    )
}

}

export default Main;
